import React, { useState } from 'react';

function RoundedTextBox(props) {
  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <input
        type="text"
        style={{
          borderRadius: '10px',
          borderBlockColor: 'blue',
          borderInlineColor: 'blue',
          height: '100px',
          width: '500px',
          padding: '10px',
          border: '1px solid gray',
        }}
        HEY
        {...props}
        HELLO
      />
    </div>
  );
}

function Header({args}){
  const mystyle = {
    color: args.color,
    textAlign: "center",
    fontSize: args.size
  };
  return(
    <div>
      <h1 style={mystyle}>{args.text}</h1>
    </div>
  );
}

function HoverButton(props) {
  const [hovered, setHovered] = useState(false);

  const handleMouseEnter = () => {
    setHovered(true);
  };

  const handleMouseLeave = () => {
    setHovered(false);
  };

  const buttonStyle = {
    backgroundColor: hovered ? props.hoverColor : props.color,
    color: props.textColor,
    border: 'none',
    padding: '11px',
    borderRadius: '5px',
    cursor: 'pointer',
  };

  const divstyle = { display: 'flex', justifyContent: 'center', alignItems: 'center' };

  return (
    <div style={divstyle}>
    <button
      style={buttonStyle}
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {props.children}
    </button>
    </div>
  );
}

function App(){
  return (
    <div>
      <Header args={{text: "AI Detector",
                     color: "green",
                     size: "50px"}}/>
      <Header args={{text: "IE3 Team ?",
                     color: "black",
                     size: "20px"}}/>               
      <RoundedTextBox placeholder="Insert text"/>
      <HoverButton color="gray" hoverColor="green" textColor="white">
        ANALYZE
      </HoverButton>
    </div>
  );
}



export default App;
